In general, routing matrix has the following schema: profile (required) is name of vehicle profile timestamp (optional) a date in RFC3999 for which routing info is applicable. Can be used for time dependent VRP. travelTimes (required) is square matrix of durations in abstract time units represented via single dimensional array distances (required) is square matrix of distances in abstract distance unit represented via single dimensional array errorCodes (optional): must be present if there is no route between some locations. Non-zero value signalizes about routing error. Both durations and distances are mapped to the list of unique locations generated from the problem definition. In this list, locations are specified in the order they defined. For example, if you have two jobs with locations A and B, one vehicle type with depot location C, then you have the following location list: A,B,C. It corresponds to the matrix (durations or distances): 0 BA CA AB 0 CB AC BC 0 where 0: zero duration or distance XY: distance or duration from X location to Y As single dimensional array it looks like: [0,BA,CA,AB,0,CB,AC,BC,0] vrp-cli command provides a helper command to get it as well as pragmatic lib exposes method to get the list pragmatically: vrp-cli solve pragmatic problem.json --get-locations -o locations.json The output format is a simply array of unique geo locations: [ { "lat": 52.52599, "lng": 13.45413 }, { "lat": 52.5225, "lng": 13.4095 }, { "lat": 52.5165, "lng": 13.3808 }, { "lat": 52.5316, "lng": 13.3884 }
] You can use it to get a routing matrix from any of routing services of your choice, but the order in resulting matrix should be kept as expected. Routing matrix example: { "profile": "normal_car", "travelTimes": [ 0, 609, 981, 906, 813, 0, 371, 590, 1055, 514, 0, 439, 948, 511, 463, 0 ], "distances": [ 0, 3840, 5994, 5333, 4696, 0, 2154, 3226, 5763, 2674, 0, 2145, 5112, 2470, 2152, 0 ]
}

