These errors are related to plan.jobs property definition. E1100 duplicated job ids error is returned when plan.jobs has jobs with the same ids: { "plan": { "jobs": [ { "id": "job1", /** omitted **/ }, { /** Error: this id is already used by another job **/ "id": "job1", /** omitted **/ } /** omitted **/ ] }
} Duplicated job ids are not allowed, so you need to remove all duplicates in order to fix the error. E1101 invalid job task demand error is returned when job has invalid demand: pickup, delivery, replacement job types should have demand specified on each job task, service type should have no demand specified: { "id": "job1", "deliveries": [ { /** omitted **/ /** Error: delivery task should have demand set**/ "demand": null } ], "services": [ { /** omitted **/ /** Error: service task should have no demand specified**/ "demand": [1] } ]
} To fix the error, make sure that each job task has proper demand. E1102 invalid pickup and delivery demand error code is returned when job has both pickups and deliveries, but the sum of pickups demand does not match to the sum of deliveries demand: { "id": "job", "pickups": [ { "places": [/** omitted **/], "demand": [1], }, { "places": [/** omitted **/], "demand": [1] } ], "deliveries": [ { "places": [/** omitted **/], /** Error: should be 2 as the sum of pickups is 2 **/ "demand": [1] } ]
} E1103 invalid time windows in jobs error is returned when there is a job which has invalid time windows, e.g.: { /** Error: end time is one hour earlier than start time**/ "times": [ [ "2020-07-04T12:00:00Z", "2020-07-04T11:00:00Z" ] ]
} Each time window must satisfy the following criteria: array of two strings each of these specifies date in RFC3339 format. The first is considered as start, the second - as end start date is earlier than end date if multiple time windows are specified, they must not intersect, e.g.: { /** Error: second time window intersects with first one: [13:00, 14:00] **/ "times": [ [ "2020-07-04T10:00:00Z", "2020-07-04T14:00:00Z" ], [ "2020-07-04T13:00:00Z", "2020-07-04T17:00:00Z" ] ]
} E1104 reserved job id is used error is returned when there is a job which has reserved job id: { /** Error: 'departure' is reserved job id **/ "id": "departure"
} To avoid confusion, the following ids are reserved: departure, arrival, break, and reload. These ids are not allowed to be used within job.id property. E1105 empty job error is returned when there is a job which has no or empty job tasks: { /** Error: at least one job task has to be defined **/ "id": "job1", "pickups": null, "deliveries": []
} To fix the error, remove job from the plan or add at least one job task to it.

