} E1301 duplicated vehicle ids error is returned when fleet.vehicles has vehicle types with the same vehicleIds: { "fleet": { "vehicles": [ { "typeId": "vehicle_1", "vehicleIds": [ "vehicle_1_a", "vehicle_1_b", /** Error: vehicle_1_b is used second time **/ "vehicle_1_b" ], /** omitted **/ }, { "typeId": "vehicle_2", "vehicleIds": [ /** Error: vehicle_1_a is used second time **/ "vehicle_1_a", "vehicle_2_b" ], /** omitted **/ } /** omitted **/ ] }
} Please note that vehicle id should be unique across all vehicle types. E1302 invalid start or end times in vehicle shift error is returned when vehicle has start/end shift times violating one of time windows rules defined for jobs in E1103. E1303 invalid break time windows in vehicle shift error is returned when vehicle has invalid time window of a break. List of break should follow time window rules defined for jobs in E1103. Additionally, break time should be inside vehicle shift it is specified: { "start": { "time": "2019-07-04T08:00:00Z", /** omitted **/ }, "end": { "time": "2019-07-04T15:00:00Z", /** omitted **/ }, "breaks": [ { /** Error: break is outside of vehicle shift times **/ "times": [ [ "2019-07-04T17:00:00Z", "2019-07-04T18:00:00Z" ] ], "duration": 3600.0 } ]
} E1304 invalid reload time windows in vehicle shift error is returned when vehicle has invalid time window of a reload. Reload list should follow time window rules defined for jobs in E1003 except multiple reloads can have time window intersections. Additionally, reload time should be inside vehicle shift it is specified: { "start": { "time": "2019-07-04T08:00:00Z", /** omitted **/ }, "end": { "time": "2019-07-04T15:00:00Z", /** omitted **/ }, "reloads": [ { /** Error: reload is outside of vehicle shift times **/ "times": [ [ "2019-07-04T17:00:00Z", "2019-07-04T18:00:00Z" ] ], "location": { /** omitted **/ }, "duration": 3600.0 } ]
}

