These errors are related to fleet.profiles property definition. E1500 duplicate profile names error is returned when fleet.profiles has more than one profile with the same name: { "profiles": [ { "name": "vehicle_profile", "type": "car" }, { "name": "vehicle_profile", "type": "truck" } ]
} To fix the issue, remove all duplicates. E1501 empty profile collection error is returned when fleet.profiles is empty: { "profiles": []
}

92.body:
These errors are related to objectives property definition. E1600 an empty objective specified error is returned when objective property is present in the problem, but no single objective is set, e.g.: { "objectives": { "primary":[] }
} objectives property is optional, just remove it to fix the problem and use default objectives. E1610 duplicate objective specified error is returned when objective of specific type specified more than once: { "objectives": { "primary": [ { "type": "minimize-unassigned" }, { "type": "minimize-unassigned" } ], "secondary": [ { "type": "minimize-cost" } ] }
} To fix this issue, just remove one, e.g. minimize-unassigned. E1611 missing cost objective error is returned when no cost objective specified (at the moment, only minimize-cost supported): { "objectives": { "primary": [ { "type": "minimize-unassigned" } ] }
} This objective is used to calculate final costs, so it is required to be specified.
